import React from "react";
import { kurtis } from "../assets";
import { CategoryCard } from "./CategoryCard";

export const Categories = () => {
  const categories = {
    0: {
      name: "Kurta",
      img: kurtis,
    },
  };
  return <div>for(category of categories){<CategoryCard />}</div>;
};
